import React, { useEffect, useState } from "react";
import { Button } from "react-bootstrap";
import Download from "./Download";

const Details = ({ data1 }) => {
  const [idata, setIdata] = useState([]);
  useEffect(() => {
    // Update state only if it's not already set
    if (!idata.length) {
      setIdata(data1);
    }
  }, [data1]);
  console.log(idata);
};

export default Details;
